export const sorting = (arrayToOrder, orderBy, order) => arrayToOrder?.sort((a, b) => {
    if (a[orderBy]?.toLowerCase() < b[orderBy]?.toLowerCase()) {
      return order === 'asc' ? -1 : 1;
    }
    if (a[orderBy]?.toLowerCase() > b[orderBy]?.toLowerCase()) {
      return order === 'asc' ? 1 : -1;
    }

    return 0;
  });
